import React from "react";

export const ProjectListViewTable = () => {
  const [{ ...projects }] = JSON.parse(localStorage.getItem("projects"));

  return (
    <div>
      <table class="table">
        <thead>
          <tr>
            <th>Project Name</th>
            <th>Team</th>
          </tr>
        </thead>
        <tfoot>
          <tr></tr>
        </tfoot>
      </table>
    </div>
  );
};
